body.script:
document.querySelector("#domainMessage1").innerText = `Please complete the security check to access ${document.domain}`;
document.querySelector("#domainMessage2").innerText = `We're doing a security check on your browser to access  ${document.domain}`;
let dotsAnimation = document.getElementById("dotsAnimation");
let dot = 3;
setInterval(() => {
    if (dot < 3) {
        dotsAnimation.innerText += ".";
        dot++;
    } else {
        dotsAnimation.innerText = "Hold on a second";
        dot = 0;
    }
}, 500);
